import './App.css';
import { Route, Routes } from 'react-router-dom';
import HomePage from './pages/HomePage';

function App() {
  return (
    <div className="container h-full mx-auto">
      <Routes>
        <Route index element={<HomePage />}></Route>
        <Route path='/create' element={<CreatePage />}></Route>
      </Routes>
    </div>
  );
}

export default App;
